import React from 'react';

function Iframe() {
    return (
      <div className="">
        <iframe src="https://www.facebook.com/plugins/page.php?href=https%3A%2F%2Fwww.facebook.com%2FPhuKienPhongTamRIWASU%2F&tabs=timeline&width=340&height=500&small_header=false&adapt_container_width=true&hide_cover=false&show_facepile=true&appId"></iframe>
      </div>
    );
  }
  
  export default Iframe;
